function App() {
	const [data, setData] = useState([{}]);

	useEffect(() => {
		fetch("/pizdec-page")
			.then((res) => res.json())
			.then((data) => {
				setData(data);
				console.log(data["pizdec"]);
			});
	});
	return <div></div>;
}

export default App;
